msg.Body = msg.payload;
msg.Bucket = flow.get("s3").bucket;
msg.Key = flow.get("s3").prefix + msg.filename;

// node.warn(msg);

return msg;

var m = [];
for (var i in msg.payload.aircraft) {
    m.push({
        payload: msg.payload.aircraft[i],
        timestamp: msg.timestamp,
        source: msg.source,
    });
}
return [m];

/*
If msg.payload is an array containing two objects,
the first object will be written as the set of named fields,
the second is the set of named tags.
*/
p = msg.payload;

fields = {
    lat: p.lat,
    lon: p.lon,
    rssi: p.rssi,
    time: Math.round((msg.timestamp - p.seen_pos) * 1000), // ugh
};

if (p.alt_baro) {
    fields.alt_baro = p.alt_baro;
}

if (p.alt_geom) {
    fields.alt_geom = p.alt_geom;
}

if (p.gs) {
    fields.gs = p.gs;
}


tags = {
    hex: p.hex,
    source: msg.source,
};

if (p.squawk) {
    tags.squawk = p.squawk;
}

if (p.emergency) {
    tags.emergency = p.emergency;
}

if (p.flight) {
    tags.flight = p.flight;
}

if (p.category) {
    tags.category = p.category;
}

msg = {
    payload: [
        // fields
        fields,

        // tags
        tags,
]};

return msg;

async function processLineByLine() {
  const fileStream = fs.createReadStream('/tmp/filtered_flights.json');

  const rl = readline.createInterface({
    input: fileStream,
    crlfDelay: Infinity
  });
  // Note: we use the crlfDelay option to recognize all instances of CR LF
  // ('\r\n') in input.txt as a single line break.

  for await (const line of rl) {
    node.send({ payload: JSON.parse(line) });
  }
}

processLineByLine();
node.done();

node.status({text: msg.moonNode.eventValue, shape: "dot", fill: "blue"});

// pass message if we're crossing the threshold for the first time
if ((msg.moonNode.eventValue >= 0.5) && (msg.moonNode.lastEventValue < 0.5)) {
    return msg;
}

var model = msg.payload.fullModel;
if (model["gcode_macro HEAT_SOAK"] != undefined) {
    var stage = model["gcode_macro HEAT_SOAK"].stage;
    var lastStage = context.get("lastStage");

    if (stage != lastStage) {
        node.status({text: "stage " + stage, shape: "dot", fill: "blue"});
        context.set("lastStage", stage);

        if ((lastStage === "soaking") && (stage === "done")) {
            return msg;
        }
    }
} else {
    node.error("no macro data: " + JSON.stringify(model));
    node.status({text: "missing data", fill: "red", shape: "ring"});
}

return {
    measurement: "process-memoryUsage",
    payload: [
        // named fields
        process.memoryUsage(),

        // named tags
        {},
    ],
};

return {
    measurement: "v8-heapStatistics",
    payload: [
        // named fields
        v8.getHeapStatistics(),

        // named tags
        {},
    ],
};

return {
    measurement: "process-cpuUsage",
    payload: [
        // named fields
        process.cpuUsage(),

        // named tags
        {},
    ],
};

return {
    measurement: "process-resourceUsage",
    payload: [
        // named fields
        process.resourceUsage(),

        // named tags
        {},
    ],
};

if ("lastUpdateId" in msg.payload) {
    return {
        payload: {
            endpoint: `/proxy/protect/ws/updates?lastUpdateId=${msg.payload.lastUpdateId}`
        }
    };
}
